import React from 'react';
import Header from '../components/Header';
import './home.css';
import arrow_right from '../assets/arrow_right.png';

const Home = () => {
    return (
        <div className='home'>
            <Header />

            <h1>Your favorite food <br></br> Delivered hot & fresh</h1>

            <p>Healthy switcher chefs do all the prep work, like peeding, chopping & marinating,
                so you can cook a fresh food
            </p>

            <button className='orderNowButton'><h3>Order Now </h3><img src={arrow_right} alt="" /></button>
        </div >
    );
};

export default Home;
